(69, 51, 'Tatabánya, Dózsa György utca 12.', 'Ez a kis lakás gyönyörű kilátással egy ideális választás mindazok számára, akik kényelmes és praktikus otthont keresnek egy csodálatos panorámával. A lakás jól kihasznált terei maximálisan kiaknázzák a rendelkezésre álló helyet, így minden helyiség tökéletesen funkcionál, miközben egy kis térben is otthonos érzést biztosít. A nappali világos, az ablakokból csodálatos kilátás nyílik, ami minden nap új élményt ad, legyen szó a naplementéről vagy a város fényeiről. A konyha kompakt, de jól felszerelt, így ideális helyszínt biztosít a napi étkezésekhez, miközben kényelmesen elfér minden szükséges eszköz. A hálószoba csendes és nyugodt, tökéletes helyet adva a pihenéshez és feltöltődéshez. A fürdőszoba praktikus és modern, minden igényt kielégít a mindennapi használathoz. A lakás elhelyezkedése előnyös, hiszen a közlekedési lehetőségek, boltok és egyéb szolgáltatások könnyen elérhetők. Bár a lakás kisebb alapterületű, a kilátás és a jól megtervezett elrendezés lehetővé teszi, hogy otthonos, kényelmes és praktikus életet éljünk, miközben élvezhetjük a látványt, amely minden nap különleges élményt nyújt. Ez a kis lakás tökéletes választás lehet egyedülállóknak, pároknak vagy bárkinek, aki a városi élet kényelmét keresve egy szép kilátású, praktikus otthont szeretne.\n\n\n\n\n\n\n\n', 'Tatabánya', 17000.00, 60, 'Wi-Fi, kutya hozható, ping-pong', 2, '2025-02-03 07:37:29'),
(70, 52, 'Gödöllő, Kossuth Lajos utca 14.', 'Ez a csendes környéken lévő ház ideális választás mindazok számára, akik nyugodt és békés környezetben szeretnének élni, miközben könnyedén elérhetik a város kényelmeit. A ház elhelyezkedése tökéletes, mivel távolabb van a város zajától, de mégis közel van a szükséges szolgáltatásokhoz, mint boltok, iskolák, éttermek és közlekedési lehetőségek. A ház tágas és világos, az ablakokból gyönyörű kilátás nyílik a környező zöldövezetre, így a reggeli kávét egy nyugodt, friss levegős környezetben fogyaszthatjuk el. A nappali barátságos és kényelmes, ideális helyet biztosít a családi együttlétekhez, a pihenéshez vagy a szórakozáshoz. Az étkező és a konyha jól el van különítve, de nyitott elrendezésüknek köszönhetően kényelmesen lehet együtt étkezni vagy közösen főzni. A konyha modern és jól felszerelt, minden szükséges eszközt biztosít a napi étkezésekhez. A hálószobák csendesek, kényelmesek, ideális helyet biztosítanak a pihenéshez, így a lakók számára mindig biztosított a nyugodt pihenés. A fürdőszoba modern és praktikus, minden igényt kielégít a mindennapi használatra. A ház körüli kert egy igazi pihenőhely, ahol a család és a barátok élvezhetik a szabadtéri programokat, kertészkedhetnek vagy egyszerűen csak pihenhetnek a friss levegőn. A csendes környék tökéletes választás azok számára, akik a nyugodt, vidéki életet keresik, miközben közel maradnak a város előnyeihez. Ez a ház minden szempontból ideális választás lehet egy család számára vagy bárkinek, aki a békés, csendes környezetben szeretne élni.', 'Gödöllő', 27000.00, 120, 'Wi-Fi, parkolás, biztonsági kamera', 4, '2025-02-03 07:37:30'),
(71, 53, 'Pécs, Kossuth utca 20.', 'Ez a nagy méretű lakás központi elhelyezkedésének köszönhetően ideális választás mindazok számára, akik a városi élet előnyeit szeretnék élvezni, miközben tágas és kényelmes otthonra vágynak. A lakás nagy belső térrel rendelkezik, amely lehetővé teszi, hogy minden családtag kényelmesen elférjen, és saját privát teret biztosítson mindenkinek. A nappali tágas és világos, a nagy ablakokból gyönyörű kilátás nyílik a városra, így a lakók minden nap élvezhetik a városi nyüzsgést. A konyha jól felszerelt, praktikus elrendezésű, és elegendő helyet biztosít a főzéshez, étkezéshez vagy családi összejövetelekhez. Az étkező és nappali egyesített terében kényelmesen elfér egy nagyobb étkezőasztal, így ideális helyszínt adva a közös étkezésekhez vagy baráti találkozókhoz. A hálószobák kényelmesek és nyugodtak, mindenki számára biztosítva a pihenést, miközben elegendő tárolóhely is rendelkezésre áll. A fürdőszobák modern stílusúak, praktikusak, és minden szükséges kényelmet biztosítanak a mindennapi használathoz. A lakás központi elhelyezkedésének köszönhetően a közlekedési lehetőségek is rendkívül kényelmesek, így könnyedén elérhetők a munkahelyek, iskolák, üzletek és egyéb fontos helyszínek. A város szívében elhelyezkedő nagy lakás minden szempontból ideális választás lehet azok számára, akik szeretnék élvezni a városi élet minden előnyét, miközben otthonos, tágas és kényelmes környezetben élnek.', 'Pécs', 30000.00, 125, 'Wi-Fi, medence, billiárd', 5, '2025-02-03 07:37:31'),
(72, 54, 'Budapest, Király utca 7.', 'Ez a tágas belvárosi lakás ideális választás mindazok számára, akik szeretnék élvezni a városi élet nyújtotta kényelmet és dinamizmust, miközben egy világos, tágas és jól elrendezett otthonban élnek. A lakás nagy belső térrel rendelkezik, amely lehetővé teszi, hogy a különböző helyiségek jól elváljanak egymástól, de mégis nyitott, légies érzést adnak. A nappali egy igazi központja a lakásnak, amelyben a nagy ablakoknak köszönhetően rengeteg természetes fény áramlik be, miközben a belső tér csodálatos kilátást biztosít a városra. A konyha modern, jól felszerelt és praktikus, ideális helyszínt biztosít a napi étkezésekhez, főzéshez vagy családi összejövetelekhez. Az étkező közvetlenül a nappali mellett található, így könnyedén összekapcsolható a közös étkezésekhez és a pihenéshez. A hálószobák tágasak és csendesek, nyugodt pihenést biztosítanak a lakóknak, miközben elegendő tárolóhelyet kínálnak. A fürdőszobák modern és elegáns kialakításúak, minden szükséges kényelmet biztosítanak a mindennapi használathoz. A lakás központi elhelyezkedésének köszönhetően a város minden fontos szolgáltatása és látnivalója könnyedén elérhető, legyen szó boltokról, éttermekről, kulturális eseményekről vagy közlekedési lehetőségekről. Ez a tágas belvárosi lakás minden szempontból ideális választás azok számára, akik szeretnék élvezni a városi élet előnyeit, miközben egy otthonos, kényelmes és praktikus környezetben élnek.', 'Budapest', 40000.00, 95, 'Wi-Fi, parkolás, baba bútorok', 3, '2025-02-03 07:37:32'),
(73, 55, 'Szentendre, Fő utca 6.', 'Ez a rendezett, csendes lakás ideális választás mindazok számára, akik nyugodt és rendezett környezetben szeretnének élni, miközben egy praktikus és kényelmes otthont keresnek. A lakás minden részlete gondosan megtervezett, hogy maximálisan kihasználja a rendelkezésre álló teret, miközben harmonikus és tiszta megjelenést biztosít. A nappali világos és tágas, a nagy ablakoknak köszönhetően természetes fény önti el a szobát, így barátságos, meleg hangulatot áraszt. Az elrendezés praktikus, a tér jól kihasználható, így minden helyiség könnyen hozzáférhető, és kényelmesen élhető. A konyha rendezett, jól felszerelt, így ideális helyszínt biztosít a napi étkezésekhez vagy a családi főzéshez. Az étkező és nappali egyesített terében kényelmesen elfér egy nagyobb étkezőasztal is, így közös étkezésekhez vagy baráti összejövetelekhez tökéletes helyet ad. A hálószobák csendesek és pihentetőek, ideális helyet biztosítanak a pihenéshez, miközben a világos színek és a tiszta vonalak segítenek a relaxációban. A fürdőszobák modern és praktikus kialakításúak, minden igényt kielégítenek, és a mindennapi használat során kényelmet biztosítanak. A lakás elhelyezkedése is kedvező, hiszen csendes környezetben található, távol a város zajától, de mégis könnyen elérhetőek a fontos szolgáltatások és közlekedési lehetőségek. Ez a rendezett, csendes lakás tökéletes választás lehet egyedülállóknak, pároknak vagy bárkinek, aki a nyugodt, kényelmes környezetet keres, miközben a praktikus és rendezett elrendezés maximális kényelmet biztosít a mindennapokban.', 'Szentendre', 22000.00, 70, 'Wi-Fi, parkolás, kutya hozható', 2, '2025-02-03 07:37:33');
INSERT INTO `ingatlanok` (`ingatlan_id`, `tulajdonos_id`, `cim`, `leiras`, `helyszin`, `ar`, `meret`, `szolgaltatasok`, `szoba`, `feltoltes_datum`) VALUES
(74, 56, 'Zalaegerszeg, Kossuth utca 8.', 'Ez a kényelmes, kis lakás tökéletes választás mindazok számára, akik praktikus és otthonos környezetet keresnek, miközben nem kívánnak túl nagy helyet fenntartani. A lakás okosan ki van alakítva, így minden négyzetcentimétert kihasználva biztosítja a kényelmet. A nappali világos és barátságos, a nagy ablakoknak köszönhetően sok természetes fényt enged be, ami tágasabbá és nyitottabbá teszi a teret. Az elrendezés praktikus, minden helyiség könnyen hozzáférhető, és a bútorok elhelyezése gondosan megtervezett, hogy maximálisan kihasználja a rendelkezésre álló helyet. A konyha kompakt, de jól felszerelt, így minden szükséges eszközzel ellátva biztosítja a kényelmes főzést és étkezést. Az étkezőhely közvetlenül a nappali mellett található, ami lehetővé teszi a közös étkezéseket és társasági pillanatokat. A hálószoba ideális pihenésre, kényelmes ággyal és elegendő tárolóhellyel rendelkezik, hogy minden szükséges dolog elférjen. A fürdőszoba praktikus és modern, tökéletesen megfelel a mindennapi igényeknek. A kis lakás ideális lehet egyedülállóknak vagy pároknak, akik nem igényelnek túl nagy helyet, de szeretnék élvezni a kényelmes és otthonos életet. A lakás elhelyezkedése is kedvező, hiszen közel találhatóak a közlekedési lehetőségek, üzletek és egyéb szolgáltatások, így mindennapi életük könnyedén megoldható. A kis lakás minden szempontból ideális választás azok számára, akik szeretnék élvezni a praktikus, kényelmes otthon adta előnyöket, miközben nem szeretnének túl sok helyet fenntartani., kis lakás', 'Zalaegerszeg', 19000.00, 55, 'Wi-Fi, grill', 1, '2025-02-03 07:37:34'),
(75, 57, 'Szombathely, Bartók Béla utca 3.', 'Ez a tágas lakás csendes helyen található, így ideális választás mindazok számára, akik a nyugodt környezetet és a kényelmes otthont keresik. A lakás nagy belső térrel rendelkezik, amely lehetővé teszi, hogy a különböző helyiségek kényelmesen elférjenek anélkül, hogy zsúfoltnak tűnnének. A nappali világos és tágas, a nagy ablakoknak köszönhetően természetes fény áramlik be, ami friss, élettel teli hangulatot biztosít. A lakás elrendezése praktikus, a tér jól kihasználható, így minden egyes szoba külön-külön is kényelmesen használható, de közvetlenül összekapcsolódik, hogy még inkább támogassa a közösségi életet. A konyha modern és jól felszerelt, minden eszközzel ellátva, amire a napi étkezésekhez szükség lehet. Az étkező és a nappali egy nyitott elrendezésben található, így kényelmesen összegyűlhet a család, barátok vagy vendégek egy közös étkezésre. A hálószobák mindegyike tágas, kényelmes és csendes, így biztosítva van a nyugodt pihenés és a feltöltődés. A fürdőszobák modern, praktikus kialakításúak, minden igényt kielégítenek. A lakás elhelyezkedése rendkívül előnyös, mivel a csendes környezet biztosítja a pihenést, miközben a város fontos szolgáltatásai könnyen elérhetők. A környék nyugodt és zöldövezeti, ideális helyszín a mindennapi élethez. Ez a tágas lakás a csendes helyen tökéletes választás lehet egyedülállóknak, pároknak vagy családoknak, akik szeretnék élvezni a nyugodt és kényelmes környezetet.', 'Szombathely', 28000.00, 110, 'Wi-Fi, parkolás, medence', 4, '2025-02-03 07:37:35'),
(76, 58, 'Kaposvár, Vas utca 17.', 'Ez a kétszobás lakás ideális választás mindazok számára, akik egy kényelmes és praktikus otthont keresnek, amely megfelelő helyet biztosít a mindennapi élethez anélkül, hogy túl nagy teret igényelne. A lakás elrendezése jól átgondolt, a két szoba különböző funkciókra is kiválóan alkalmas, legyen szó pihenésről, dolgozásról vagy vendégek fogadásáról. A nappali tágas és világos, nagy ablakainak köszönhetően sok természetes fényt enged be, ami friss és barátságos légkört teremt. A hálószoba kényelmes, ideális helyet biztosít a pihenéshez, miközben elég tárolóhelyet kínál a személyes dolgok számára. A konyha praktikus és jól felszerelt, minden szükséges eszközzel rendelkezik a napi étkezésekhez. Az étkező közvetlenül a nappali mellett helyezkedik el, ami kényelmes helyszínt biztosít a közös étkezésekhez. A fürdőszoba modern és funkcionális, tökéletesen megfelel a mindennapi igényeknek. A lakás elhelyezkedése is rendkívül előnyös, hiszen könnyen elérhetőek a közlekedési lehetőségek, üzletek, éttermek és egyéb fontos szolgáltatások. Ez a kétszobás lakás ideális választás lehet egyedülállóknak, pároknak vagy kisebb családoknak, akik egyszerű, de kényelmes otthont keresnek. A jól kihasznált tér és praktikus elrendezés minden szempontból kényelmes életet biztosít.', 'Kaposvár', 21000.00, 70, 'Wi-Fi, mosógép, légkondícionálás', 2, '2025-02-03 07:37:36'),
(77, 59, 'Eger, Kossuth Lajos utca 15.', 'Ez az egyedi stílusú lakás különleges hangulatával és egyedi kialakításával azonnal magára vonja a figyelmet. A lakás minden részlete gondosan megtervezett, hogy egyesítse a modern dizájnt a személyre szabott, kreatív elemekkel, amelyek tükrözik a lakó egyedi ízlését és stílusát. A nappali egy igazi művészeti tér, ahol a különleges bútorok és dekorációk harmonikusan illeszkednek egymáshoz, így egyedi, mégis otthonos légkört teremtenek. A színek merészek és szemet gyönyörködtetők, a világos és sötét árnyalatok keveredése izgalmas dinamikát ad a helyiségnek. A konyha is rendkívül figyelemfelkeltő, modern eszközökkel felszerelve, de egyedi, kézzel készült elemekkel, amelyek valóban különleges hangulatot adnak neki. Az étkező egy különleges, designban gazdag hely, ahol az étkezések valódi élménnyé válnak. A hálószobákban a különböző textúrák és anyagok keverése az egyik legszembetűnőbb vonás, a stílusos, kényelmes bútorok pedig tökéletes pihenést biztosítanak. A fürdőszobák is az egyediség jegyében készültek, a modern fürdőszobai felszerelések mellett a színpaletta és a formák kreatív kombinációja teszi őket igazán különlegessé. A lakás minden helyisége az egyedi stílusú kialakítással maximálisan kihasználja a teret, így minden négyzetcentimétere egy igazi műalkotás. Az elrendezés is praktikus, a lakás minden funkcionális igényt kielégít, miközben megőrzi azt a különleges hangulatot, amely az egyedi stílust jellemzi. Ez az egyedi stílusú lakás ideális választás azoknak, akik egy olyan otthont keresnek, amely nemcsak kényelmes, hanem egy igazi művészeti alkotás is egyben.', 'Eger', 33000.00, 115, 'Wi-Fi, parkolás', 4, '2025-02-03 07:37:37'),
(78, 60, 'Visegrád, Váci utca 9.', 'Ez a ház lenyűgöző kilátással rendelkezik, amely minden reggel és este új élményt kínál. Az ablakokból és teraszról csodálatos panoráma tárul elénk, amely a környező tájat, hegyeket vagy a várost lenyűgöző módon öleli körbe. A tágas nappali és étkező ideális helyszínt biztosít a kilátás élvezetéhez, hiszen a nagy üvegfelületek és a nyitott tér lehetővé teszik, hogy minden pillanatban a természet szépségét figyelhessük. A terasz, amely közvetlen kapcsolatban áll a nappalival, tökéletes helyszín egy kellemes reggeli kávé elfogyasztásához, vagy egy nyári este kellemes pihenéséhez. A hálószobák szintén a kilátásra orientálódnak, így minden reggel egy gyönyörű táj köszönt minket, ami segít a nyugodt ébredésben és a pihentető alvásban. Az otthon minden részlete a kilátásra fókuszál, a bútorok és a dizájn úgy lettek megválasztva, hogy ne vonják el a figyelmet a környező táj szépségéről. A kert is egy mesés hely, ahol a növények és a táj tökéletes harmóniában találkoznak. Az udvar és a kert lehetőséget ad arra, hogy teljesen átéljük a környezetet, legyen szó pihenésről, kertészkedésről vagy baráti összejövetelekről. A ház a természet közelségében található, ugyanakkor a város is könnyen elérhető, így a nyugodt, csendes élet és a városi lehetőségek közötti tökéletes egyensúlyt biztosítja. Ez a ház csodálatos kilátása valóban különlegessé teszi az otthont, így minden nap új élményt és szépséget kínál.', 'Visegrád', 48000.00, 160, 'Wi-Fi, medence, grill', 5, '2025-02-03 07:37:38'),
(79, 61, 'Sopron, Hársfa utca 3.', 'Ez az új építésű lakás modern dizájnjával és prémium minőségű anyagaival azonnal lenyűgözi az érdeklődőket. A legújabb építési technológiákkal készült, így nemcsak esztétikai szempontból kifogástalan, hanem energiahatékonyság szempontjából is kiemelkedő. A tágas, nyitott elrendezésű nappali és konyha egy igazi központja lesz az otthonnak, ahol a modern bútorok és az új, stílusos konyhai eszközök egyedülálló élményt nyújtanak. A nagy ablakoknak köszönhetően a természetes fény minden szobát beragyog, miközben a szigetelésnek köszönhetően a lakás egész évben kellemes hőmérsékleten tartható. Az elrendezés praktikus, minden egyes szoba kényelmes és jól kihasználható, így akár egyedülállóknak, pároknak, vagy kis családoknak is ideális otthont biztosít. A hálószobák nyugodt, pihentető környezetet kínálnak, míg a fürdőszobák elegáns és modern kialakításúak, minden kényelmet biztosítva a napi használathoz. Az új építésű lakás minden részletében a legmagasabb szintű minőség és kényelem ötvöződik, a legmodernebb műszaki megoldásokkal és design elemekkel. A lakás környéke is rendkívül vonzó, hiszen a közlekedés könnyen elérhető, a környéken pedig számos szolgáltatás, bolt és étterem található. Az új építésű lakás ideális választás mindazok számára, akik a modern életstílust, kényelmet és a legújabb technológiákat keresik.', 'Sopron', 32000.00, 105, 'Wi-Fi, akadálymentes, kert', 3, '2025-02-03 07:37:39'),
(80, 62, 'Vác, Kossuth utca 5.', 'Ez a kellemes, napfényes lakás igazi oázis a mindennapi rohanásból. A nagy ablakoknak köszönhetően minden szoba bőséges természetes fényt kap, így az egész lakás világos és élettel teli. A nappali különösen kellemes, ahol a napfény reggelente beszűrődik, meleg és barátságos légkört teremtve. A fényes terek még inkább kiemelik a modern bútorok és dekorációk szépségét, miközben a lakás minden egyes helyisége kényelmes és praktikus. A konyha is ragyogóan világos, ami a főzéshez ideális hangulatot biztosít, miközben a nappali és étkező egy nyitott elrendezésben biztosítja a kényelmes közösségi tér érzését. A hálószobák is a napfény hatására nyugodt és pihentető környezetet kínálnak, ahol a reggeli napsütés segít friss energiával indítani a napot. A lakás minden szeglete gondosan megtervezett, hogy kihasználja a természetes fény adta előnyöket, és a világos terek kellemes, hívogató hangulatot teremtenek. Az otthon modern kialakítása mellett a praktikus elrendezés és a tágas helyiségek biztosítják, hogy a lakás minden igényt kielégítsen. A csendes környék és a központ közelsége ideális választássá teszi ezt a napfényes lakást mindazok számára, akik a nyugodt, kényelmes, de élettel teli otthonokat keresik.', 'Vác', 23000.00, 80, 'Wi-Fi, kert, horgásztó', 2, '2025-02-03 07:37:40'),
(81, 63, 'Székesfehérvár, Petőfi utca 2.', 'Ez a kertes ház tökéletes egyensúlyt kínál a belvárosi élet dinamikája és a nyugodt, zöld környezet között. A ház közvetlen közelében található a belváros, így minden fontos szolgáltatás, étterem, bolt és közlekedési lehetőség könnyen elérhető. Ugyanakkor a kert, amely körülveszi a házat, egy valódi oázist jelent, ahol a csend és a természet közelsége adja meg a pihenés ideális helyszínét. A kertben helyet kapott egy rendezett, gondozott zöldfelület, ami tökéletes lehetőséget ad a szabadtéri tevékenységekre, például a kertészkedésre, pihenésre vagy baráti összejövetelekre. A ház tágas belső terekkel rendelkezik, ahol a nagy ablakoknak köszönhetően a zöld kert minden szobából gyönyörűen látható. Az elrendezés praktikus, minden helyiség jól kihasználható, így akár családok, akár párok számára ideális választás. A nappali és étkező teret ad a közös időtöltéshez, miközben a konyha modern és jól felszerelt. A hálószobák nyugodt pihenést biztosítanak, és a zöld kert látványa még inkább hozzájárul a kellemes hangulathoz. Az otthon hangulata meleg és barátságos, ideális hely azok számára, akik a városi közelséget keresik, de szeretnék élvezni a természet nyugalmát is. Ez a kertes ház a belváros közelében mindazok számára tökéletes választás, akik a nyüzsgő város mellett egy csendes, zöld környezetben szeretnének otthont találni.', 'Székesfehérvár', 34000.00, 130, 'Wi-Fi, parkolás, takarító szolgálat', 4, '2025-02-03 07:37:41'),
(82, 64, 'Miskolc, Vörösmarty utca 11.', 'Ez a szép lakás kiváló központi elhelyezkedésével tökéletes választás mindazok számára, akik szeretnék élvezni a városi élet adta előnyöket. A lakás a város szívében található, így minden fontos szolgáltatás, étterem, bolt, kávézó és közlekedési lehetőség könnyedén elérhető, mindössze pár lépésre. Az ingatlan belső tere tágas és világos, a gondosan megtervezett elrendezés pedig maximálisan kihasználja a teret, hogy kényelmes és funkcionális otthont biztosítson. A nappali az otthon központi része, ahol a modern bútorok és a jól megválasztott színek egyedi hangulatot adnak, miközben az ablakokból csodálatos kilátás nyílik a városra. A konyha modern és jól felszerelt, így ideális helyszínt biztosít a főzéshez, míg az étkező egy kényelmes és hangulatos hely a családi étkezésekhez vagy baráti összejövetelekhez. A hálószobák nyugodt és pihentető környezetet kínálnak, a nagy ablakoknak köszönhetően pedig természetes fény tölti meg a helyiségeket. A lakás fürdőszobája elegáns, modern kialakítással, minden kényelmi funkcióval, ami szükséges a napi frissüléshez. A központi elhelyezkedés nemcsak kényelmet biztosít, hanem remek közlekedési lehetőségeket is kínál, így könnyen elérhetőek a munkahelyek, szórakozási lehetőségek és a város kulturális látnivalói. Ez a szép lakás a központi elhelyezkedésével ideális választás mindazok számára, akik szeretik a város pezsgését, miközben kényelmes és modern otthonra vágynak.', 'Miskolc', 21000.00, 75, 'Wi-Fi, parkolás, erkély/terasz', 3, '2025-02-03 07:37:42'),
(83, 65, 'Kecskemét, Kossuth utca 22.', 'Ez a szép, tágas lakás a kényelmes élet minden igényét kielégíti. A nagy terek világos, nyitott elrendezése lehetővé teszi, hogy az otthon minden részlete szellős és légies legyen. A nappali különösen tágas, ideális helyszín a pihenésre és a családi összejövetelekre, miközben a nagy ablakoknak köszönhetően a napfény szabadon áramlik a helyiségbe, még inkább fokozva a tér érzését. A modern dizájn és a jól megválasztott bútorok tökéletes harmóniában találkoznak, így a lakás minden része stílusos és praktikus. A konyha szintén tágas, és a modern, jól felszerelt eszközöknek köszönhetően ideális helyszín a főzéshez, miközben az étkező egy kényelmes közösségi térként szolgál. A hálószobák elég nagyok ahhoz, hogy mindenki saját pihenőhelyet alakíthasson ki, és mindegyik szoba világos, nyugodt légkört kínál, amely segít a kellemes és pihentető alvásban. A lakás minden szeglete átgondolt és jól kihasznált, a helyiségek közötti átjárás könnyű és gördülékeny. A fürdőszoba szintén tágas, modern kialakítású, minden kényelmet biztosítva. A lakás környezetét tekintve ideális választás azoknak, akik szeretnének élni egy tágas, kényelmes otthonban, amely a praktikumot és a szépséget ötvözi. Az ingatlan tökéletes hely azok számára, akik szeretik a bőséges teret és a modern életstílust.', 'Kecskemét', 28000.00, 95, 'Wi-Fi, biztonsági kamera, golfpálya', 3, '2025-02-03 07:37:43'),
(84, 66, 'Pécs, Alkotmány utca 3.', 'Ez a kis lakás ideális választás mindazok számára, akik szeretnék élvezni a város közelségét anélkül, hogy túl sok helyet igényelnének. A lakás közel helyezkedik el a központhoz, így minden fontos szolgáltatás, étterem, bolt és közlekedési lehetőség könnyen elérhető, mindössze pár perc sétára. A kis méret ellenére a lakás nagyon jól kihasználja a rendelkezésre álló teret, a praktikus elrendezés pedig kényelmes és funkcionális otthont biztosít. A nappali és konyha egy légtérben található, ami segít, hogy a tér nyitott és világos maradjon, miközben minden szükséges bútor és eszköz rendelkezésre áll. A hálószoba nyugodt és intim környezetet kínál, ahol a pihenés kényelme biztosított. A lakás minden részlete átgondolt, így nemcsak helytakarékos, hanem stílusos és praktikus is. A kis fürdőszoba jól felszerelt, és maximálisan kihasználja a rendelkezésre álló helyet. A központ közelsége nemcsak a kényelmet, hanem a város pezsgésének élményét is biztosítja. Ez a kis lakás tökéletes azok számára, akik a városi élet előnyeit keresik, de egy kompakt és jól elrendezett otthonban szeretnének élni.', 'Pécs', 17000.00, 50, 'Wi-Fi, biztonsági kamera, kert', 1, '2025-02-03 07:37:44'),
