(98, 80, 'Szombathely, Jókai utca 12.', 'Ez a modern lakás a belváros szívében található, így ideális választás mindazok számára, akik a városi élet pezsgését keresik, miközben egy kényelmes, korszerű otthonra vágynak. A lakás tágas, világos nappalijában a nagy ablakoknak köszönhetően rengeteg természetes fény áramlik be, így a tér nyitottnak és barátságosnak tűnik. A modern dizájn, letisztult vonalak és magas minőségű anyagok jellemzik a lakást, biztosítva, hogy minden részlet a legújabb trendeknek megfelelően van kialakítva. A konyha teljesen felszerelt, praktikus elrendezéssel, ideális helyszínt biztosít a mindennapi főzéshez, miközben az étkezővel való egybeépítése lehetővé teszi a közös étkezések élvezetét. A hálószobák kényelmesek és pihentetőek, ideálisak a nyugodt pihenéshez, miközben minden tárolóhely okosan van elhelyezve, hogy maximálisan kihasználja a rendelkezésre álló teret. A fürdőszoba szintén modern, letisztult stílusú, minden szükséges kényelmi felszereléssel. A lakás elhelyezkedése lehetővé teszi, hogy a város legfontosabb éttermek, kávézók, üzletek és szórakozóhelyek mind könnyen elérhetők legyenek. A közlekedési lehetőségek is kiválóak, így a mindennapi ingázás gyorsan és kényelmesen megoldható. Ez a lakás tökéletes választás azok számára, akik a belváros nyújtotta lehetőségeket szeretnék kihasználni, miközben modern, kényelmes otthonra vágynak.', 'Szombathely', 31000.00, 105, 'Wi-Fi, parkolás, erkély/terasz', 3, '2025-02-03 07:37:58'),
(99, 81, 'Kaposvár, Fő utca 14.', 'Ez a tágas lakás egy gyönyörű, parkosított udvarral rendelkezik, amely ideális helyet biztosít a pihenéshez és a szabadban való kikapcsolódáshoz. A lakás belső tere rendkívül világos és jól elrendezett, a nagy ablakoknak köszönhetően természetes fény áramlik be minden szobába, ami még inkább növeli a tér érzését. A nappali egy kényelmes központja a lakásnak, amely ideális helyszínt biztosít a családi vagy baráti összejövetelekhez, miközben a parkosított udvarra nyíló kilátás igazi nyugodt, zöld környezetet kínál. A konyha és étkező nyitott térben helyezkednek el, modern felszereltséggel, ami megkönnyíti a mindennapi étkezéseket és közösségi programokat. A hálószobák tágasak és pihentetőek, mindegyik saját szekrényekkel és tárolóhelyekkel van ellátva, így kényelmesen elférnek a személyes dolgok. A fürdőszoba elegáns, modern kialakítású, minden szükséges kényelemmel. Az udvar különleges jellemzője, hogy parkosított, zöld növényekkel és fákkal körülvett, ideális hely a pihenésre, kertészkedésre, vagy akár szabadtéri programok rendezésére is. A lakás elhelyezkedése is ideális, hiszen egy nyugodt, zöld környezetben helyezkedik el, de mégis könnyen elérhetők a város fontos pontjai, üzletek, éttermek és közlekedési lehetőségek. Az ingatlan egy tökéletes választás mindazok számára, akik a városi élet és a természet közelségét szeretnék egyesíteni egy kényelmes, tágas otthonban.', 'Kaposvár', 28000.00, 120, 'Wi-Fi, parkolás, ping-pong', 4, '2025-02-03 07:37:59'),
(100, 82, 'Eger, Kossuth utca 10.', 'Ez az újépítésű lakás modern dizájnnal és prémium minőségű anyagokkal lett kialakítva, így minden részlete a legújabb trendeknek megfelelően van megtervezve. A lakás belső terét tágas, világos terek jellemzik, amelyek lehetővé teszik, hogy a napfény szabadon áramoljon a lakás minden szegletébe, így a tér nyitottnak és barátságosnak tűnik. A nappali különösen kényelmes, ideális hely a pihenésre vagy családi összejövetelekre, miközben a modern bútorok és kiegészítők segítenek a hangulatos atmoszféra megteremtésében. A konyha teljesen felszerelt, letisztult vonalvezetésű, és elegendő helyet biztosít a főzéshez és étkezéshez, míg az étkező elegáns, modern helyszínt kínál a közös étkezésekhez. A hálószobák kényelmesek és pihentetőek, ideálisak a nyugodt alváshoz, és mindegyik szoba praktikus tárolóhelyekkel van ellátva, hogy minden rendben legyen. A fürdőszoba szintén modern és stílusos, minden szükséges kényelmi felszereléssel. Az újépítésű lakás előnye, hogy minden technikai eszköz és berendezés új, így biztosítva van a magas energiahatékonyság és a hosszú távú fenntarthatóság. A lakás elhelyezkedése is kiváló, hiszen a város szívében, jól megközelíthető helyen található, így a közlekedési lehetőségek, üzletek és éttermek mind könnyen elérhetők. Ez a szép, újépítésű lakás tökéletes választás mindazok számára, akik egy kényelmes, modern otthont keresnek, ahol minden igényt kielégítenek a legújabb technológiák és dizájn megoldások.', 'Eger', 33000.00, 110, 'Wi-Fi, medence, akadálymentes', 3, '2025-02-03 07:38:00'),
(101, 83, 'Visegrád, Rákóczi utca 5.', 'Ez a kényelmes, két szobás lakás ideális választás azok számára, akik egy praktikus, jól elrendezett otthont keresnek. Az ingatlan tágas nappali szobája a lakás központja, amely világos, barátságos hangulatot áraszt a nagy ablakoknak köszönhetően, melyek sok természetes fényt engednek be. A nappali elegáns és kényelmes bútorokkal van berendezve, így ideális hely a pihenéshez, családi összejövetelekhez vagy baráti beszélgetésekhez. A két hálószoba külön-külön is kényelmes és jól felszerelt, mindkettőben bőséges tárolóhely található, hogy rend és tisztaság uralkodjon a térben. A konyha modern, jól felszerelt és praktikus, így könnyedén készíthetők el benne a napi étkezések. Az étkező könnyedén kapcsolódik a nappalihoz, így ideális helyszínt biztosít a közös étkezésekhez. A fürdőszoba tiszta és egyszerűen berendezett, minden szükséges kényelemmel felszerelve, míg a WC külön helyiségben található, biztosítva a lakás kényelmét. Az ingatlan elhelyezkedése is előnyös, mivel a közlekedési lehetőségek könnyen elérhetők, és a környék minden szükséges szolgáltatást biztosít. A lakás tökéletes választás fiatal pároknak, egyedülállóknak vagy kis családoknak, akik egy kényelmes és jól elrendezett otthonra vágynak.', 'Visegrád', 20000.00, 70, 'Wi-Fi, baba bútorok', 2, '2025-02-03 07:38:01'),
(102, 84, 'Sopron, Kisfaludy utca 3.', 'Ez a családi ház kiválóan ötvözi a nyugodt családi életet a város közelségével, hiszen központi elhelyezkedésének köszönhetően minden fontos szolgáltatás könnyen elérhető. A ház tágas, jól átgondolt elrendezésű, és a nappali nagy ablakain keresztül rengeteg természetes fényt enged be, így a belső terek világosak és barátságosak. A nappali és az étkező egy nyitott térben helyezkednek el, ideális helyszínt biztosítva a családi együttlétekhez vagy a barátokkal való szórakozáshoz. A konyha modern és jól felszerelt, sok tárolóhellyel, ami megkönnyíti a mindennapi étkezéseket és főzéseket. A ház három hálószobája kényelmes és pihentető, mindegyik saját szekrényekkel és praktikus tárolóhelyekkel rendelkezik. A fürdőszobák stílusosak és kényelmesek, modern berendezéssel, mindegyik igény szerint kialakítva. A ház egy szép kerttel rendelkezik, ahol a család szabadidős tevékenységeket végezhet, a gyerekek biztonságosan játszhatnak, és a felnőttek is élvezhetik a pihenést. Az ingatlan központi elhelyezkedése lehetővé teszi a gyors hozzáférést a város fontos pontjaihoz, beleértve a munkahelyeket, iskolákat, bevásárlóközpontokat és szórakozóhelyeket. A közlekedési lehetőségek is kiválóak, így a házból könnyedén elérhetők a város többi részei is. Ez a családi ház ideális választás mindazok számára, akik szeretnék élvezni a városi élet előnyeit, miközben egy kényelmes, tágas otthonra vágynak.', 'Sopron', 38000.00, 150, 'Wi-Fi, medence', 5, '2025-02-03 07:38:02'),
(103, 85, 'Vác, Dózsa György utca 18.', 'Ez a nagy, tágas lakás rendkívüli lehetőséget kínál mindazok számára, akik a bőséges tér és a kényelem hívei. Az ingatlan belső terét világos, nyitott terek jellemzik, amelyek lehetővé teszik, hogy a napfény szabadon áramoljon a lakás minden szegletébe, így még inkább fokozva a tágasság érzetét. A nappali központi szerepet kap, hiszen ez a helyiség ideális a pihenésre, családi együttlétekre vagy baráti összejövetelekre. Az étkező és a konyha egy nyitott térben helyezkednek el, ami kényelmes és praktikus, mivel egy légtérben biztosítja a közös étkezéseket és az ételkészítést. A konyha modern, jól felszerelt és elegáns, rengeteg tárolóhellyel és munkafelülettel. A hálószobák külön-külön is rendkívül tágasak, mindegyik saját szekrényekkel, tárolóhelyekkel és pihenésre ideális hangulattal rendelkezik. A fürdőszoba elegáns és kényelmes, modern felszerelésekkel és zuhanyzóval vagy fürdőkáddal. A lakás egyik nagy előnye, hogy rengeteg tárolóhelyet kínál, így minden elfér, ami az otthoni rendet biztosítja. A tágas erkély vagy terasz pedig lehetőséget ad arra, hogy a lakók a friss levegőn pihenjenek vagy kertészkedjenek. Az ingatlan elhelyezkedése szintén ideális, hiszen könnyen elérhetők a közlekedési lehetőségek, üzletek és éttermek. A nagy, tágas lakás tökéletes választás azok számára, akik nemcsak kényelmes, hanem szellős, tágas otthonra vágynak, ahol mindenki kényelmesen elfér és élvezheti a tágas életteret.', 'Vác', 35000.00, 120, 'Wi-Fi, parkolás, kávéfőző', 4, '2025-02-03 07:38:03'),
(104, 86, 'Székesfehérvár, Vörösmarty utca 1.', 'Ez a modern lakás ideális választás mindazok számára, akik szeretik a városi életet, de egy kényelmes, stílusos otthont is keresnek. Az ingatlan központi elhelyezkedésének köszönhetően könnyen elérhetők a város legfontosabb pontjai, mint például üzletek, éttermek, kávézók, kultúrális központok és a közlekedési hálózat, így a mindennapi teendők gyorsan és kényelmesen intézhetők. A lakás dizájnja modern és letisztult, a legújabb trendeknek megfelelően, amely ötvözi a funkcionalitást és az esztétikát. A tágas nappali az egész lakás szíve, melyet nagy ablakok világítanak meg, így a tér világos és nyitott. A nappali és étkező egy nyitott térben van kialakítva, lehetővé téve a közösségi életet és a baráti összejöveteleket. A konyha modern eszközökkel van felszerelve, így minden étkezési igényt kielégít, a pultok, tárolóhelyek és készülékek mind praktikusan elrendezve vannak. A hálószoba nyugodt, pihentető helyet biztosít a lakók számára, kényelmes ággyal, szekrényekkel és minden szükséges tárolóhellyel. A fürdőszoba is modern, magas minőségű anyagokkal van felszerelve, mindegyik részletét figyelmesen megtervezték, hogy maximális kényelmet nyújtson. Az ingatlan előnye, hogy alacsony fenntartási költségekkel rendelkezik, mivel a modern építkezési megoldásoknak és energiahatékony berendezéseknek köszönhetően fenntartható és gazdaságos. A központi elhelyezkedés pedig ideális választás azok számára, akik az aktív városi életet szeretnék élvezni, miközben egy modern, kényelmes és stílusos otthonra vágynak.', 'Székesfehérvár', 33000.00, 110, 'Wi-Fi, mosógép, takarító szolgálat', 3, '2025-02-03 07:38:04'),
(105, 87, 'Miskolc, Váci utca 9.', 'Ez a kis lakás tökéletes választás azok számára, akik a város zajától távol, mégis minden fontos helyszín közelében szeretnének élni. A zöldövezetben található ingatlan csendes és nyugodt környezetet biztosít, így ideális pihenésre, feltöltődésre. A lakás belső terei praktikusak és jól kihasználtak, minden szoba gondosan megtervezett, hogy a lehető legnagyobb kényelmet nyújtsa. A nappali szoba világos, barátságos, ahol a nagy ablakokon keresztül a zöld környezet is belátható, így még inkább fokozza a nyugodt atmoszférát. A konyha jól felszerelt és modern, praktikus elrendezéssel, így kényelmesen készíthetők el az étkezések. A hálószoba tökéletes hely a pihenéshez, kényelmes ággyal és tárolóhelyekkel. A fürdőszoba egyszerű, de minden szükséges kényelemmel rendelkezik. A lakás előnye, hogy bár kicsi, az elrendezése lehetővé teszi, hogy minden egyes négyzetmétert kihasználjanak, miközben fenntartja a tágas és kényelmes érzetet. A zöldövezet biztosítja, hogy a lakók élvezhessék a friss levegőt, és könnyen hozzáférhetnek a közeli parkokhoz vagy sétautakhoz. Ez a kis lakás ideális azok számára, akik a természet közelségét és a városi kényelmet egyaránt szeretnék élvezni.', 'Miskolc', 19000.00, 60, 'Wi-Fi, grill, kutya hozható', 2, '2025-02-03 07:38:05'),
(106, 88, 'Kecskemét, Hunyadi utca 6.', 'Ez a tágas lakás tökéletes választás mindazok számára, akik a kényelmes életteret és a könnyű közlekedési lehetőségeket egyaránt értékelik. Az ingatlan elhelyezkedése kiemelkedő, hiszen a közlekedési csomópontok, mint busz- és villamosmegállók, mindössze pár perc sétára találhatóak, így a város bármelyik pontjára gyorsan és kényelmesen elérhetők. A lakás belső terét világos, tágas szobák jellemzik, melyek ideálisak a pihenésre, munkára vagy családi együttlétekre. A nappali egy nyitott tér, amely a lakás központját képezi, és elegendő helyet biztosít akár egy nagyobb társaság számára is. Az étkező és konyha egy légtérben helyezkednek el, praktikus elrendezésüknek köszönhetően kényelmes étkezéseket biztosítanak a család számára. A konyha modern eszközökkel van felszerelve, rengeteg tárolóhellyel, ami könnyedén segít fenntartani a rendet. A hálószobák tágasak és pihentetőek, saját tárolóhelyekkel és szekrényekkel rendelkeznek, így ideálisak a privát pihenéshez. A fürdőszobák modern kialakításúak, kényelmesek és praktikusak. A lakás előnye, hogy az elrendezés maximálisan kihasználja a teret, így minden szoba kényelmes és jól szellőző. Az ingatlan kiváló közlekedési lehetőségei mellett, számos szolgáltatás is könnyen elérhető, mint üzletek, éttermek, iskolák vagy szórakozóhelyek. Ez a tágas lakás ideális választás azok számára, akik kényelmes, világos otthont keresnek, miközben a város szívéből gyorsan és kényelmesen közlekedhetnek.', 'Kecskemét', 27000.00, 90, 'Wi-Fi, parkolás, akadálymentes', 3, '2025-02-03 07:38:06'),
(107, 89, 'Pécs, Hunyadi utca 9.', 'Ez az új lakás ideális választás mindazok számára, akik a modern életstílust keresik, miközben a város központjának közelségét élvezhetik. Az ingatlan a legújabb építési szabványoknak megfelelően készült, így biztosítva van a magas szintű energiahatékonyság, a korszerű anyagok és a kényelmes elrendezés. A lakás tágas, világos terei tökéletesek a pihenésre és a mindennapi élethez szükséges tevékenységekre. A nappali a lakás központi helyisége, melyet nagy ablakok világítanak meg, így maximálisan kihasználja a természetes fényt. Az étkező és konyha egy nyitott térben található, praktikus elrendezésének köszönhetően ideális a családi étkezésekhez és baráti összejövetelekhez. A konyha modern felszereltséggel rendelkezik, amely lehetővé teszi a kényelmes főzést és étkezést. A hálószoba csendes és pihentető, ideális hely a mindennapi pihenésre, ráadásul elegendő tárolóhellyel is rendelkezik. A fürdőszoba a legújabb design szerint lett kialakítva, magas minőségű felszerelésekkel és praktikus tárolási lehetőségekkel. Az ingatlan központ közeli elhelyezkedése lehetővé teszi, hogy minden fontosabb szolgáltatás könnyedén elérhető legyen: üzletek, éttermek, kávézók, közlekedési lehetőségek és egyéb városi szolgáltatások mind pár percre találhatóak. A lakás környezetét friss és nyugodt légkör jellemzi, biztosítva ezzel a kellemes városi életet. Ez az új lakás ideális választás mindazok számára, akik kényelmes, modern otthont keresnek, miközben élvezhetik a városi élet minden előnyét.', 'Pécs', 31000.00, 115, 'Wi-Fi, medence, légkondícionálás', 4, '2025-02-03 07:38:07');
INSERT INTO `ingatlanok` (`ingatlan_id`, `tulajdonos_id`, `cim`, `leiras`, `helyszin`, `ar`, `meret`, `szolgaltatasok`, `szoba`, `feltoltes_datum`) VALUES
(108, 90, 'Budapest, Margit körút 6.', 'Ez a tágas belvárosi lakás ideális választás azok számára, akik szeretnék élvezni a városi élet minden előnyét, miközben egy kényelmes, modern otthonra vágynak. Az ingatlan központi elhelyezkedésének köszönhetően mindössze pár perc sétára találhatóak a város legfontosabb helyszínei, mint üzletek, éttermek, kávézók, kulturális központok és szórakozóhelyek, így minden szükséges szolgáltatás könnyedén elérhető. A lakás belső terei tágasak és világosak, így ideálisak a mindennapi élethez. A nappali szoba az egész lakás központját képezi, ahol kényelmesen pihenhetünk vagy barátainkkal együtt tölthetjük az időt. A nyitott konyha-étkező rész praktikus elrendezése lehetővé teszi a kényelmes főzést és étkezést, míg a konyha modern eszközökkel és elegendő tárolóhellyel van felszerelve. A hálószobák tágasak, világosak és kényelmesek, megfelelő tárolóhelyekkel a ruhák és egyéb személyes tárgyak számára. A fürdőszoba modern kialakítású, magas minőségű berendezésekkel, amelyek kényelmes és pihentető fürdőzést biztosítanak. A lakás előnye, hogy az elrendezés maximálisan kihasználja a rendelkezésre álló teret, így minden szoba praktikus és kényelmes. Az ingatlan központi elhelyezkedése biztosítja, hogy gyorsan elérhetők legyenek a közlekedési csomópontok is, így könnyedén hozzáférhetők a város többi része. Ez a tágas belvárosi lakás ideális választás mindazok számára, akik szeretnék élvezni a városi élet dinamikáját, miközben egy kényelmes és tágas otthont keresnek.', 'Budapest', 40000.00, 140, 'Wi-Fi, parkolás, kutya hozható', 4, '2025-02-03 07:38:08'),
(109, 91, 'Szentendre, Római part 3.', 'Kis ház áll a folyópart közelében, ahol a reggeli napfény csókkal ébreszti a természetet. A kertjében vadvirágok nyílnak, és a madarak éneke betölti a levegőt, miközben a folyó csendesen csobog, mintha meséket mondana a régi időkől. A ház ablakaiból lenézve gyakran látni a halászbárkát, amint lassan úszik el, míg a tetőn pihennek a galambok, és néha egy-egy mókus is ellátogat a közeli fára. Este a ház fénye melegséget áraszt, és a füst szaga keveredik a friss levegővel, miközben a ház előtt álló kis padon az öregember gyakran üldögél, és nézi a vizet. Tavasszal a folyó partján sárga nárciszok törnek elő, mint apró napok, és a ház falait borító zöld klimatiszek mindig újra virágoznak, mintha örök élet lenne bennük. Itt, ezen a csendes helyen, az idő megáll, és az ember megtalálja a békét, amit máshol hiába keres.', 'Szentendre', 35000.00, 130, 'Wi-Fi, horgászó, erkély/terasz', 4, '2025-02-03 07:38:09'),
(110, 92, 'Zalaegerszeg, Arany János utca 7.', 'Kényelmes, két szobás lakás található a város szívében, ahol a modern kényelmet összekapcsolják az otthon meleg hangulatával. A nappali tágas és világos, nagy ablakokkal, amelyeken át ömlik be a napfény, és kiemeli a falak világos színét. A kanapé puha, a könyvespolc pedig tele van kedvenc könyvekkel és emlékekkel, amelyek a lakók történetét mesélik el. A konyha kiválóan felszerelt, modern gépekkel és elegáns burkolattal, ahol könnyedén elkészíthető egy reggeli kávé vagy egy hosszú vacsora barátokkal. A hálószoba nyugodt színei és a kényelmes ágy garantálják a pihentető éjszakákat, míg a második szoba akár irodaként, akár vendégszobaként funkcionál, rugalmasságot biztosítva. A lakásban minden gondolat megvalósult, hogy otthon érezze magát az ember, ahol a mindennapok zajától elvonulhat, és feltöltődhet.\n\n', 'Zalaegerszeg', 22000.00, 75, 'Wi-Fi, házi mozi, mosógép', 2, '2025-02-03 07:38:10'),
(111, 93, 'Szombathely, Vasvári Pál utca 10.', 'Új építésű lakás található a város központja közelében, ahol a modern élet minden kényelmét magában foglalja. A lakás tágas és világos, nagy ablakokkal, amelyeken át bőségesen árad be a napfény, kiemelve a falak friss, világos színeit és a modern bútorok letisztult vonalait. A nyílt elrendezésű nappali és étkező terület tökéletes együttlétre és szórakoztatásra, míg a konyha csillogó fehér felületekkel és legújabb készülékekkel várja a főzés szerelmeseit. A hálószoba igazi nyugalom szigete, puha szövetekkel és kényelmes ággyal, ahol a fáradt nap után tökéletesen ki lehet pihenni. A második szoba sokoldalúan használható, akár gyerekszobaként, akár irodaként, rugalmasságot biztosítva a lakók számára. A fürdőszoba modern, zuhanyfülkével és elegáns csempékkel, ahol reggelente felélénkülve indulhat a nap. A lakás központi elhelyezkedése lehetővé teszi, hogy minden, amire szükség van, csak néhány percre legyen, mégis a csendes udvar és a dupla rétegű ablakok biztosítják a nyugalmat. Ez a lakás nem csupán egy otthon, hanem egy életstílus, ahol a kényelem és a funkcionalitás találkozik.\n\n', 'Szombathely', 33000.00, 120, 'Wi-Fi, parkolás, légkondícionálás', 3, '2025-02-03 07:38:11'),
(112, 94, 'Kaposvár, Zrínyi utca 14.', 'Szép, napfényes lakás vár a harmadik emeleten, ahol a napsugarak egész nap átölelik a tereket, és meleget, vidámságot hoznak a mindennapokba. A lakás tágas és légies, nagy ablakokkal, amelyeken keresztül lenyűgöző kilátás nyílik a városra vagy a zöldellő udvarra. A falak világos színei és a természetes fény hatására a lakás még tágasabbnak és barátságosabbnak tűnik, miközben a modern bútorok és a gondosan kiválasztott dekoráció harmonikusan egészítik ki az egészet. A nappali központja egy kényelmes kanapénak, ahol a napfényben olvasni vagy pihenni lehet, míg az étkezőasztalnál reggelente egy friss kávé mellett élvezhető a napsütés. A konyha kiválóan felszerelt, tiszta vonalakkal és praktikus megoldásokkal, ahol a főzés örömévé válik. A hálószoba nyugodt hangulatú, puha textíliákkal és egy kényelmes ággyal, ahol a nap végén tökéletesen ki lehet pihenni. A fürdőszoba modern, tiszta vonalakkal és friss színekkel, ahol a reggeli zuhany egy igazi ébredési élmény. Ez a lakás nem csupán egy otthon, hanem egy olyan hely, ahol a napfény és a szépség minden nap inspirál.\n\n', 'Kaposvár', 27000.00, 95, 'Wi-Fi, erkély/terasz, kávéfőző', 3, '2025-02-03 07:38:12'),
(113, 95, 'Eger, Felsőváros, Rákóczi utca 5.', 'Családi ház áll a város szélén, egy hatalmas, zöldellő kert közepén, ahol a természet és az otthon melege tökéletes harmóniában találkozik. A ház tágas és vendégszerető, nagy ablakokkal, amelyeken keresztül a napfény ömlik be, megvilágítva a falak meleg színeit és a fa bútorok természetes szépségét. A nappali központja egy nagy kandallónak, amely télen meleget, hangulatot ad, míg nyádon a tágas terasz nyitott ajtókon keresztül összeköti a belső tereket a kerttel. A konyha tágas és kiválóan felszerelt, ahol a család könnyedén összegyűlhet, és együtt készítheti el a napi ételeket. A hálószobák nyugodtak és kényelmesek, nagy ágyakkal és sok tárolóhellyel, míg a gyerekszobák színesek és kreatívak, tele játékkal és ötlettel. A kert valódi kincse a háznak, hatalmas fákkal, virágágyásokkal és egy gyepes területtel, ahol a gyerekek szabadon futkoshatnak, és a család piknikezhet vagy grillpartit rendezhet. A kert végében található egy kis kerti ház is, amely akár műhelyként, akár nyugalom szigeteként szolgál. Ez a családi ház nem csupán egy otthon, hanem egy olyan hely, ahol a szeretet, a nevetés és az emlékek egy életen át tartanak.\n\n', 'Eger', 39000.00, 140, 'Wi-Fi, parkolás, medence', 4, '2025-02-03 07:38:13'),
(114, 96, 'Visegrád, Templom utca 3.', 'Családi ház áll egy domb tetején, csodálatos kilátással a környező tájra, ahol a természet lenyűgöző szépsége minden nap inspirál. A ház tágas és hangulatos, nagy ablakokkal, amelyeken keresztül lenyűgöző panoráma tárul a szem elé, akár a zöldellő dombok, a távoli erdők, vagy akár a naplementék lenyugvó színei. A nappali központja egy hatalmas üvegajtónak, amely kinyílik egy tágas teraszra, ahol reggelente egy friss kávé mellett élvezhető a kilátás, vagy este a csillagok alatt lehet pihenni. A konyha modern és kényelmes, kiválóan felszerelt, hogy a főzés közben is élvezni lehessen a táj szépségét. A hálószobák tágasak és nyugodtak, nagy ágyakkal és puha textíliákkal, ahol a reggeli napsütés ébreszti az embert. A gyerekszobák színesek és kreatívak, tele játékokkal és ötletekkel, míg a kertben hatalmas terület várja a családot, virágágyásokkal, gyepes területekkel és egy kis kerti házacskával, amely tökéletes hely a pihenésre vagy a kreatív tevékenységekre. Ez a családi ház nem csupán egy otthon, hanem egy olyan hely, ahol a természet csodái minden nap emlékeztetnek az élet szépségére.', 'Visegrád', 42000.00, 150, 'Wi-Fi, medence, grill', 5, '2025-02-03 07:38:14'),
