(116, 98, 'Vác, Duna utca 13.', 'Két szobás lakás található a város egyik élénk negyedében, kiváló közlekedési lehetőségekkel, amelyek lehetővé teszik, hogy könnyedén elérjük a város minden pontját. A lakás tágas és világos, nagy ablakokkal, amelyeken át bőségesen árad be a napfény, megvilágítva a falak friss, világos színeit és a modern bútorok letisztult vonalait. A nappali központja egy kényelmes kanapénak, amely tökéletes hely a pihenésre vagy a barátokkal való összejövetelre, míg az étkezőasztalnál reggelente egy friss kávé mellett élvezhető a városi élet lendülete. A konyha kiválóan felszerelt, modern gépekkel és elegáns burkolattal, ahol a főzés örömévé válik. A hálószoba nyugodt hangulatú, puha textíliákkal és egy kényelmes ággyal, ahol a nap végén tökéletesen ki lehet pihenni. A második szoba sokoldalúan használható, akár gyerekszobaként, akár irodaként, rugalmasságot biztosítva a lakók számára. A fürdőszoba modern, zuhanyfülkével és elegáns csempékkel, ahol a reggeli zuhany egy igazi ébredési élmény. A lakás központi elhelyezkedése és a kiváló közlekedési lehetőségek lehetővé teszik, hogy minden, amire szükség van, csak néhány percre legyen, mégis a csendes udvar és a dupla rétegű ablakok biztosítják a nyugalmat. Ez a lakás nem csupán egy otthon, hanem egy életstílus, ahol a kényelem és a funkcionalitás találkozik.', 'Vác', 22000.00, 75, 'Wi-Fi, takarító szolgálat, baba bútorok', 2, '2025-02-03 07:38:16'),
(117, 99, 'Székesfehérvár, Dózsa György utca 11.', 'Tágas, világos lakás található egy csendes lakótelepen, ahol a modern kényelem és a természet közelsége tökéletesen egyesül. A lakás nagy ablakokkal rendelkezik, amelyeken keresztül bőségesen árad be a napfény, megvilágítva a falak friss, világos színeit és a modern bútorok letisztult vonalait. A nappali központja egy kényelmes kanapénak, amely tökéletes hely a pihenésre vagy a barátokkal való összejövetelre, míg az étkezőasztalnál reggelente egy friss kávé mellett élvezhető a természet szépsége. A konyha kiválóan felszerelt, modern gépekkel és elegáns burkolattal, ahol a főzés örömévé válik. A hálószoba nyugodt hangulatú, puha textíliákkal és egy kényelmes ággyal, ahol a nap végén tökéletesen ki lehet pihenni. A második szoba sokoldalúan használható, akár gyerekszobaként, akár irodaként, rugalmasságot biztosítva a lakók számára. A fürdőszoba modern, zuhanyfülkével és elegáns csempékkel, ahol a reggeli zuhany egy igazi ébredési élmény. A lakás tágas terasza nyitott a kertre, ahol a friss levegőn lehet pihenni vagy akár egy kis kertet gondozni. Ez a lakás nem csupán egy otthon, hanem egy olyan hely, ahol a kényelem és a természet közelsége minden nap inspirál.', 'Székesfehérvár', 30000.00, 100, 'Wi-Fi, erkély/terasz, légkondícionálás', 3, '2025-02-03 07:38:17'),
