(119, 101, 'Kecskemét, Jókai utca 10.', 'Modern, világos lakás található egy újépítésű lakóparkban, ahol a korszerű design és a funkcionalitás tökéletesen egyesül. A lakás nagy ablakokkal rendelkezik, amelyeken keresztül bőségesen árad be a napfény, megvilágítva a falak friss, világos színeit és a modern bútorok letisztult vonalait. A nappali központja egy kényelmes kanapénak, amely tökéletes hely a pihenésre vagy a barátokkal való összejövetelre, míg az étkezőasztalnál reggelente egy friss kávé mellett élvezhető a napfény. A konyha kiválóan felszerelt, modern gépekkel és elegáns burkolattal, ahol a főzés örömévé válik. A hálószoba nyugodt hangulatú, puha textíliákkal és egy kényelmes ággyal, ahol a nap végén tökéletesen ki lehet pihenni. A második szoba sokoldalúan használható, akár gyerekszobaként, akár irodaként, rugalmasságot biztosítva a lakók számára. A fürdőszoba modern, zuhanyfülkével és elegáns csempékkel, ahol a reggeli zuhany egy igazi ébredési élmény. A lakás tágas terasza nyitott a zöldellő udvarra, ahol a friss levegőn lehet pihenni vagy akár egy kis kertet gondozni. Ez a lakás nem csupán egy otthon, hanem egy olyan hely, ahol a modern design és a kényelem minden nap inspirál.\n\n', 'Kecskemét', 26000.00, 95, 'Wi-Fi, biztonsági kamera, parkolás', 3, '2025-02-03 07:38:19'),
(120, 102, 'Pécs, Béla utca 12.', 'Egy családi ház, nagy udvarral, ahol a gyerekek szabadon játszhatnak. A kertben egy kis tó is található, amelyben aranyhalak úszkálnak. A ház mellett egy tágas garázs áll, amelyben két autó is kényelmesen elfér. Az udvar végében egy kis veteményeskert kapott helyet, ahol friss zöldségeket lehet termeszteni. A teraszon egy kényelmes ülőgarnitúra áll, ahol a család együtt töltheti a nyári estéket. A ház belső tere világos és tágas, nagy ablakai rengeteg természetes fényt engednek be. A nappaliban egy kandalló gondoskodik a meghitt hangulatról a hideg téli napokon. A konyha modern és jól felszerelt, így ideális a közös főzésekhez. Az emeleti szobákból csodás kilátás nyílik a környező dombokra. Ez az otthon nemcsak kényelmes, hanem meghitt és barátságos is, ahol mindenki jól érezheti magát.', 'Pécs', 37000.00, 130, 'Wi-Fi, parkolás, ping-pong', 4, '2025-02-03 07:38:20'),
(121, 103, 'Budapest, Erzsébet körút 2.', 'Egy kényelmes belvárosi lakás, amely tökéletes választás azok számára, akik szeretik a pezsgő városi életet. A lakás tágas nappalival rendelkezik, amelynek nagy ablakai rengeteg természetes fényt engednek be. A modern konyha minden szükséges felszereléssel ellátott, így ideális a mindennapi főzéshez. A hálószoba csendes és nyugodt, így a város zaja sem zavarja az itt lakókat. A fürdőszoba elegáns kialakítású, kényelmes káddal és zuhanyzóval. Az ingatlanhoz tartozik egy kis erkély is, ahonnan remek kilátás nyílik a belváros nyüzsgő utcáira. A lakás elhelyezkedése kiváló, hiszen boltok, kávézók és éttermek egyaránt sétatávolságon belül találhatók. A tömegközlekedés könnyen elérhető, így gyorsan és kényelmesen lehet eljutni a város bármely pontjára. Az igényesen berendezett belső tér harmonikus és otthonos hangulatot áraszt. Ez a lakás ideális választás azok számára, akik szeretik a modern kényelmet és a városi élet dinamizmusát.', 'Budapest', 36000.00, 120, 'Wi-Fi, parkolás, takarító szolgálat', 3, '2025-02-03 07:38:21'),
(122, 104, 'Szentendre, Mátyás király utca 3.', 'Egy kis ház, csendes környéken, távol a város zajától, ahol a nyugalom és a természet közelsége mindennap érezhető. A ház egyszerű, de otthonos kialakítású, tökéletes egy kis család vagy egy egyedül élő ember számára. A nappali világos és barátságos, nagy ablakai a gondozott kertre néznek. A konyha kompakt, mégis jól felszerelt, így minden szükséges eszköz rendelkezésre áll a főzéshez. A hálószoba kellemes és meghitt, ahol igazán kipihenheti magát az ember. A kertben egy kis terasz is helyet kapott, ahol jólesik reggelente a madárcsicsergés mellett kávézni. A szomszédság barátságos, az utcák nyugodtak, így ideális a sétákhoz és a kikapcsolódáshoz. A környéken erdők és mezők találhatók, amelyek kiváló lehetőséget biztosítanak kirándulásra és természetjárásra. A ház egyszerűsége ellenére igazi menedék, ahol a hétköznapok rohanása után meg lehet találni a békét és a harmóniát.', 'Szentendre', 21000.00, 80, 'Wi-Fi, biztonsági kamera, légkondícionálás', 2, '2025-02-03 07:38:22'),
(123, 105, 'Zalaegerszeg, Bajza utca 10.', 'Egy kis lakás, nyugodt helyen, ahol a csend és a meghittség mindennapos. Ez az otthon tökéletes választás azok számára, akik szeretik a visszafogott, kényelmes életteret, távol a város zajától. A nappali kompakt, de világos, ahol egy kényelmes kanapé és egy kis étkezőasztal is helyet kapott. A konyha praktikus elrendezésű, minden fontos eszközzel felszerelve, így ideális a mindennapi főzéshez. A hálószoba kellemes és barátságos, ahol a pihenés zavartalan. A fürdőszoba modern és ízléses kialakítású, zuhanyzóval és elegáns részletekkel. Az apró erkély vagy a kis kertkapcsolat lehetőséget ad arra, hogy a friss levegőn is kikapcsolódhasson az ember. A környék csendes és biztonságos, ahol nyugodtan lehet sétálni vagy egy könyvet olvasni a természet közelségében. A közlekedés kényelmes, a fontosabb boltok és szolgáltatások könnyen elérhetők. Ez a kis lakás igazi kis menedék, ahol a nyugalom és az otthonosság találkozik.\n\n\n\n\n\n\n\n', 'Zalaegerszeg', 19000.00, 55, 'Wi-Fi, takarító szolgálat, kutya hozható', 1, '2025-02-03 07:38:23'),
(124, 106, 'Szombathely, Fő utca 13.', 'Egy nagy lakás, közel a központhoz, amely tökéletes választás azok számára, akik szeretik a tágas tereket és a városi élet nyüzsgését. A nappali hatalmas ablakain keresztül rengeteg természetes fény áramlik be, miközben a város panorámája elénk tárul. A modern és jól felszerelt konyha elegendő helyet biztosít a főzéshez és a közös étkezésekhez. A lakás több hálószobával rendelkezik, így ideális nagyobb családok vagy akár lakótársak számára is. A fürdőszoba tágas, kényelmes káddal és zuhanyzóval, hogy mindenki megtalálja a számára megfelelő kényelmet. Az ingatlanhoz tartozik egy erkély is, ahol kellemes reggeleket lehet eltölteni egy csésze kávé mellett. A központ közelsége miatt éttermek, kávézók, üzletek és kulturális programok mind pár perc sétára találhatók. A tömegközlekedés kiváló, így könnyen és gyorsan elérhető a város bármely pontja. A lakás modern berendezése és tágas elrendezése igazán kényelmes és elegáns életteret biztosít. Ez az otthon egyszerre kínál nagy teret, kényelmet és a városi élet lüktetését.', 'Szombathely', 30000.00, 120, 'Wi-Fi, parkolás, kert', 3, '2025-02-03 07:38:24'),
(125, 107, 'Kaposvár, Kossuth utca 7.', 'Egy modern lakás, remek közlekedéssel, amely tökéletes választás azok számára, akik a kényelmet és a praktikus elhelyezkedést egyaránt fontosnak tartják. A lakás világos és tágas, nagy ablakai rengeteg természetes fényt engednek be. A nappali stílusos berendezésű, kényelmes kanapéval és elegáns dekorációval, amely igazán otthonossá teszi a teret. A konyha modern és teljesen felszerelt, így a főzés nemcsak egyszerű, hanem élvezetes is. A hálószoba letisztult és nyugodt hangulatot áraszt, tökéletes hely a pihenéshez egy hosszú nap után. A fürdőszoba ízlésesen kialakított, zuhanyzóval és prémium minőségű berendezésekkel. Az ingatlanhoz tartozik egy kis erkély is, amely ideális reggeli kávézáshoz vagy esti kikapcsolódáshoz. A lakás elhelyezkedése kiváló, hiszen a közelben boltok, éttermek és szórakozási lehetőségek egyaránt megtalálhatók. A tömegközlekedés kiváló, így könnyen elérhetők a város különböző részei, akár busszal, villamossal vagy metróval. Ez a lakás nemcsak modern és kényelmes, hanem praktikus is, hiszen a városi élet minden előnyét kínálja.', 'Kaposvár', 28000.00, 100, 'Wi-Fi, parkolás, medence', 3, '2025-02-03 07:38:25'),
(126, 108, 'Eger, Törökdomb, Rákóczi utca 3.', 'Egy családi ház, csendes helyen, ahol a nyugalom és a természet közelsége mindennap érezhető. Az otthon tágas és világos, nagy ablakai rengeteg természetes fényt engednek be. A nappali kényelmes és barátságos, ahol a család együtt töltheti az estéket. A konyha modern és jól felszerelt, így tökéletes a közös főzésekhez és étkezésekhez. A ház több hálószobával rendelkezik, így minden családtagnak jut egy saját, meghitt tér. A fürdőszoba tágas, ízléses kialakítású, kényelmes káddal és zuhanyzóval. Az udvar rendezett, zöldellő növényekkel és virágokkal, ahol a gyerekek biztonságban játszhatnak. A terasz tökéletes helyszín a pihenésre, legyen szó egy reggeli kávéról vagy egy baráti grillezésről. A környék nyugodt és biztonságos, távol a város zajától, mégis könnyen megközelíthető. Ez a ház ideális választás azok számára, akik egy harmonikus, kényelmes és természetközeli otthont keresnek.', 'Eger', 36000.00, 140, 'Wi-Fi, medence, grill', 4, '2025-02-03 07:38:26'),
