(128, 110, 'Sopron, Várkerület 5.', 'Egy új lakás, kiváló közlekedéssel, amely ideális választás azok számára, akik a modern életstílust és a praktikus elhelyezkedést keresik. Az ingatlan frissen épített, így minden berendezés és felszerelés vadonatúj, a legmodernebb technológiával. A nappali világos és tágas, nagy ablakai miatt egész nap napfény áramlik be, miközben a teret elegáns bútorok és modern dekoráció teszi otthonossá. A konyha jól felszerelt, minden szükséges eszközzel, így kényelmesen lehet főzni és étkezni. A hálószoba csendes és nyugodt, ideális pihenésre, hogy a nap végén zavartalanul pihenhessen. A fürdőszoba modern, prémium anyagokkal van felszerelve, kádas és zuhanyzós kialakítással. Az ingatlanhoz tartozik egy erkély is, ahol friss levegőt lehet élvezni a város szívében. A közlekedés tökéletes, hiszen a lakás pár lépésnyire található a legközelebbi busz- és villamosmegállóktól, így a város bármely része gyorsan és könnyen elérhető. A környéken üzletek, éttermek és egyéb szolgáltatások találhatók, amelyek mind kényelmesen megközelíthetők. Ez az új lakás egy igazi modern otthon, amely tökéletes választás a dinamikus városi élethez.', 'Sopron', 33000.00, 120, 'Wi-Fi, légkondícionálás, akadálymentes', 3, '2025-02-03 07:38:28'),
(129, 111, 'Vác, Szabadság utca 9.', 'Egy nagy lakás, közel a központhoz, amely ideális választás azok számára, akik szeretnék élvezni a városi élet előnyeit, miközben tágas és kényelmes otthonra vágynak. A lakás világos, tágas nappalija nagy ablakain keresztül csodás kilátást nyújt a környező városra, és rengeteg természetes fényt enged be. A modern konyha teljesen felszerelt, a legújabb technológiai eszközökkel, így a főzés és étkezés igazi élmény. Az ingatlan több hálószobával rendelkezik, így bőven van hely családoknak vagy akár vendégek számára is. A fürdőszoba elegáns kialakítással, kényelmes káddal és zuhanyzóval várja a lakókat. A lakás egy nagy erkélyt is kínál, ahol reggelente nyugodtan pihenhetünk vagy élvezhetjük a friss levegőt. A központ közelsége lehetővé teszi, hogy éttermek, kávézók, boltok és kulturális programok mind könnyedén elérhetők legyenek. A tömegközlekedési lehetőségek kiválóak, így akár gyalogosan, akár busszal vagy metróval gyorsan elérhetjük a város többi részét. A lakás ideális azok számára, akik szeretik a kényelmet, a tágas tereket és a városi élet pezsgését.', 'Vác', 29000.00, 100, 'Wi-Fi, kutya hozható, erkély/terasz', 3, '2025-02-03 07:38:29'),
(130, 112, 'Székesfehérvár, Munkácsy utca 15.', 'Egy kényelmes családi ház, amely tökéletes otthont biztosít minden család számára. A ház tágas nappalija egybenyílik a konyhával, így egy nagy, nyitott tér jön létre, amely ideális a közös családi étkezésekhez és pihenéshez. A modern konyha teljesen felszerelt, kényelmesen elfér benne minden eszköz, ami a mindennapi főzéshez szükséges. A ház több hálószobával rendelkezik, így minden családtagnak saját, nyugodt pihenőhelye van. A fürdőszoba tágas, kényelmes káddal és zuhanyzóval, hogy mindenki megtalálja a számára legjobb kikapcsolódást. A ház egy gyönyörű kerttel is rendelkezik, ahol a gyerekek biztonságosan játszhatnak, miközben a felnőttek élvezhetik a friss levegőt. A terasz tökéletes hely a nyári esték eltöltésére, grillezéssel vagy egy pohár bor mellett. Az ingatlan elhelyezkedése ideális, hiszen nyugodt környéken található, mégis könnyen megközelíthető a város, iskolák és boltok. A ház minden részlete a kényelemre lett tervezve, így minden családtag megtalálhatja a számára legjobban megfelelő helyet ebben az otthonos környezetben.', 'Székesfehérvár', 40000.00, 150, 'Wi-Fi, parkolás, billiárd', 5, '2025-02-03 07:38:30'),
