CREATE TRIGGER `prevent_same_renter_owner` BEFORE INSERT ON `foglalasok` FOR EACH ROW BEGIN
    DECLARE tulajdonos INT;

    -- Lekérdezzük az ingatlan tulajdonosának ID-ját
    SELECT tulajdonos_id INTO tulajdonos
    FROM ingatlanok
